import React from 'react';

const BlueprintsList = ({ blueprints }) => {
  if (!blueprints || blueprints.length === 0) {
    return <p>No hay planos disponibles.</p>;
  }

  return (
    <div>
      <h2>Lista de Planos</h2>
      <ul>
        {blueprints.map((blueprint, index) => (
          <li key={index}>
            {blueprint.name} by {blueprint.author} - {blueprint.points.length} points
          </li>
        ))}
      </ul>
    </div>
  );
};

export default BlueprintsList;
